import React, { useState } from 'react';

const HarmonyGenerator = () => {
  const [primaryHue, setPrimaryHue] = useState(0);

  useEffect(() => {
    setPrimaryHue(Math.floor(Math.random() * 360));
  }, []);

  return (
    <div>
      <p>{primaryHue}</p>
    </div>
  );
};

export default HarmonyGenerator;
